import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import LoginPage from './LoginPage.js';
import HomePage from './HomePage.js';

function App() {
  const [isAuthenticated, setIsAuthenticated] = useState(false);

  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/logonpage" element={<LoginPage setIsAuthenticated={setIsAuthenticated} />} />
          <Route 
            path="/homepage" 
            element={isAuthenticated ? <HomePage /> : <LoginPage setIsAuthenticated={setIsAuthenticated} />} 
          />
          <Route 
            path="/" 
            element={isAuthenticated ? <HomePage /> : <LoginPage setIsAuthenticated={setIsAuthenticated} />} 
          />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
